import React from "react";
import DarkMode from "../DarkMode";
import styled from "styled-components";
import { Link } from "react-router-dom";

const AsideBar = styled.aside`
  position: relative;
  left: -510px;
`;

const Nav = styled.nav``;

const Ul = styled.ul`
  list-style: none;
  margin-top: 59px;
  display: flex;
  flex-direction: column;
  gap: 25px;
`;

const FirstUl = styled(Ul)`
  margin-top: 39px;
`;

const ListTitle = styled.p`
  font-family: Lato;
  font-weight: 700;
  font-size: 18px;
  line-height: 21.6px;
  color: ${({ theme }) =>
    theme.isDarkMode ? "rgba(249, 249, 249, 0.67)" : "black"};
`;

const Li = styled.li`
  color: white;
`;
const StyledLink = styled(Link)`
  background-color: ${({ theme }) => (theme.isDarkMode ? "black" : "#fff")};
  color: ${({ theme }) => (theme.isDarkMode ? "#fff" : "black")};
  text-decoration: none;
  font-family: Lato, sans-serif;
  font-size: 18px;
  font-weight: 600;
  line-height: 21.6px;
  text-align: left;
  display: flex;
  gap: 15px;
`;

const Aside = () => {
  return (
    <AsideBar>
      <Nav>
        <FirstUl>
          <ListTitle>
            Menu <DarkMode />
          </ListTitle>
          <Li>
            <StyledLink to="/">
              <img src="/images/Squircle.png"></img>Home
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <img src="/images/Discover.png"></img>Discover
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <img src="/images/Award.png"></img>Awards
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <img src="/images/Celebrities.png"></img>Celebrities
            </StyledLink>
          </Li>
        </FirstUl>
        <Ul>
          <ListTitle>Library</ListTitle>
          <Li>
            <StyledLink to="/">
              <img src="/images/Recent.png"></img>Recent
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <img src="/images/Top Rated.png"></img>Top Rated
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <img src="/images/Downloaded.png"></img>Downloaded
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <img src="/images/Playlists.png"></img>Playlists
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <img src="/images/Watchlist.png"></img>Watchlist
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <img src="/images/Completed.png"></img>Completed
            </StyledLink>
          </Li>
        </Ul>
        <Ul>
          <ListTitle>General</ListTitle>
          <Li>
            <StyledLink to="/">Settings</StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">Log Out</StyledLink>
          </Li>
        </Ul>
      </Nav>
    </AsideBar>
  );
};

export default Aside;
